        type: Sequelize.INTEGER,

    },product_image:{
        type:Sequelize.TEXT
    },
    product_name: {
        type: Sequelize.TEXT
    },
    product_stock: {
        type: Sequelize.INTEGER
    }
}, {
    timestamps: false
});

export default products;

