  const user = await users.findOne({
    where: {
      user_email: profile.emails[0].value
    }
  });
  const token = jwt.sign({
    user_email: user_email
  }, process.env.TOKEN_SECRET);
  if (user == null) {
    password = cryptr.encrypt(password);
    let newUser = await users.create({
      user_name,
      user_email,
      password,
      user_type,
      auth_token: token,
